import {useState, useEffect} from 'react';
const GetArticles = ()=>{
    const [articles, setArticles] = useState([]);
    useEffect(()=>{
        fetch('https://arena-django-backend.herokuapp.com/')
        .then(res=>res.json())
        .then(data=>{
            setArticles(data);
        })
    });

    return{
        articles
    }
}

export default GetArticles;
